import { useState } from "react";
import { Form } from "react-router-dom";
import axios from "axios";

const Signup = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [signup, setSignup] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("submit");
  }

  return (
    <>
      <Form onSubmit={(e) => handleSubmit(e)}>
        <p>
          <label htmlFor="FirstName">Frist Name</label>
          <input id="FirstName" type="FirstName" name="FirstName" value={firstName} onChange={(e) => setFirstName(e.target.value)} required />
        </p>
        <p>
          <label htmlFor="LastName">Last Name</label>
          <input id="LastName" type="LastName" name="LastName" value={lastName} onChange={(e) => setLastName(e.target.value)} required />
        </p>
        <p>
          <label htmlFor="email">Email</label>
          <input id="email" type="email" name="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
        </p>
        <p>
          <label htmlFor="password">Password</label>
          <input id="password" type="password" name="password" value={password} onChange={(e) => setPassword(e.target.value)} required />
        </p>
        <div>
            <button onClick={(e) => handleSubmit(e)}>Sign Up</button>
        </div>
      </Form>
    </>
  );
};

export default Signup;
